css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #70748f;
  padding: 5px;
  border-bottom: 1px solid #c6c8d2;
}
.github-Accordion-header::-webkit-details-marker {
  color: #70748f;
}
.github-Accordion-content {
  border-bottom: 1px solid #c6c8d2;
  background-color: #e8e9ed;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #70748f;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #121317;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid #c6c8d2;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #d1d3db;
}
